import Foto from '../static/FotoLuisBrito.jpg';
const PersonalData = () => (
    <div>
        <div className="container">
            <div className="image">
                <img  src={Foto}></img>
            </div>

            <div className="datos">
                <h1>Datos Personales</h1>
                <ul>
                    <li>Nombre: Luis Manuel</li>
                    <li>Apellido: Brito Romero</li>
                    <li>Telefono: +58 414 092.96.37</li>
                    <li>Direccion: Charallave -Edo. Miranda</li>
                    <li>Email: lsbrt4@gmail.com</li>
                </ul>
            </div>
        </div>
        
            <style jsx> {`
            .container{
                width:100%;
                margin:20px;
                border: 1px solid blue;
                background-color: gray;
                display: grid;
                grid-template-columns: repeat(auto-fill, minmax(320px, 1fr) );
            }
            .datos{
                text-align: center;
                border: 1px solid black;
                width: 100%;
                grid-column: span2 / span 3;
            }
            .datos ul{
                list-style-type: none;
                margin: 0;
                padding: 0;
            }
            .image{
                width:auto;
                display: block;
                padding-left: 50px;
                width: 100%;
            }

            .image img{
                width: 250px;
                border-radius: 50%;  
                align: center;    
            }

            `}
            </style>
    </div>
);

export default PersonalData;
